const CarCard = ({ car }) => {
  return (
    <div className="car-card">
      <img src={car.image} alt={`${car.brand} ${car.model}`} className="car-image" />
      <h3>{car.brand} {car.model}</h3>
      <p>Потужність: {car.power} hp</p>
      <p>Макс. швидкість: {car.maxSpeed} км/год</p>
    </div>
  );
};

export default CarCard;
